  return (
    <div>
      <h1>User 1</h1>
      <h1>User 2</h1>
      <h1>User 3</h1>
      <Outlet/>
      <div>
        <button>Show Active Users</button>
        <button>Show All Users</button>
      </div>
    </div>
  )
}

export default Users
